import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { GET_ALL_STORE_SAGA } from '../redux/type/StoreType'

export default function Nav() {

    const dispatch = useDispatch()
    const { listStore } = useSelector(state => state.storeReducer)

    useEffect(() => {
        dispatch({
            type: GET_ALL_STORE_SAGA
        })
    }, [])

    const renderLink = () => {
        return listStore.map((item, index) => {
            let t = index+1
            return <a style={{color:'white', fontSize: '22px', height: '50px'}} className="nav-link" aria-current="page" href="gdsgsd">Store </a>
        })
    }
    return (
        <div>
            <nav className="nav flex-column" style={{ width: '100%%', backgroundColor: '#163975', minHeight: '713px' }}>
                <p style={{ color: 'white', paddingTop: '30px', fontSize: '25px', fontWeight: '400', fontFamily: 'revert' }}>Milk Tea Store</p>
                <div style={{ marginTop: '50px' }}>
                    {renderLink()}
                </div>
            </nav>
        </div>
    )
}
